body_text:
@karthee320, ComputeCpp isn't working with the official TensorFlow repository yet.
You'll have to use the eigen_sycl branch of https://github.com/codeplaysoftware/tensorflow to make it work. Note that you will need ComputeCpp 0.9.1 and bazel 0.11.1.
Hope this helps!

